/* 取得 GTM8 時間 */
var getnow_GMT8 = function( callback ){
    var date = new Date();
    gmtHours = date.getTimezoneOffset()/60;
    date.setTime( date.getTime()+gmtHours*3600000 + 28800000 );
    callback && callback( date );
};


var request_infomation = function( time ){
    
    var string = querystring.stringify({
        'ctl00$ctl02':                      'ctl00$cphMain$ctl00|ctl00$cphMain$btnQuery',
    //'ctl02_HiddenField':                ';;AjaxControlToolkit, Version=3.0.20820.16598, Culture=neutral, PublicKeyToken=28f01b0e84b6d53e:zh-TW:707835dd-fa4b-41d1-89e7-6df5d518ffb5:9ea3f0e2:e2e86ef9:c7c04611:1df13a87:cd120801:c4c00916:3858419b:96741c43:38ec41c0',
        'ctl00$cphMain$cboSearch':          '全部',
        'ctl00$cphMain$ucDate$cboYear':     time.getFullYear(),
        'ctl00$cphMain$ucDate$cboMonth':    time.getMonth()+1,
        'ctl00$cphMain$ucDate$cboDay':      time.getDate(),
        'ctl00$cphMain$ucDate$cboHour':     time.getHours(),
        'ctl00$cphMain$ucDate$cboMinute':   Math.floor( time.getMinutes()/10 ) * 10,
        '__EVENTTARGET':                    'ctl00$cphMain$btnQuery',
        '__VIEWSTATE':                      '',
        '__VIEWSTATEGENERATOR':             'A9B75289',
        '__EVENTVALIDATION':                '',
        '__ASYNCPOST':                       true
    });
    return string;
}
    
var request_water_each_hour = function(){     //跟wra.gov.tw取得水庫資料
    getnow_GMT8( request_water );
}

var request_water_for_time = function( time ){
    request_water( time );
}

var request_water = function( Time ){
    var info = request_infomation( Time );
    request.post('http://fhy.wra.gov.tw/ReservoirPage_2011/Statistics.aspx')
        .set('Content-Type', 'application/x-www-form-urlencoded; charset=UTF-8')
        .set('Content-Length',  Buffer.byteLength( info ) )
        .set('User-Agent', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.152 Safari/537.36' )
        .send( info )
        .end( function( err, res ){
            if( res.err ){
                console.log("->" + res.error.message );
            }
            else{
                console.log( res.status );
                Sresponse( res.text, Time  );
            }
        } );
};

var Save_to_file = function( filename, element ){
    filename = filename.replace( /\s/, '_' );
    fs.writeFile( '.\/data\/'+filename, JSON.stringify(element), 'utf-8', function( err, data ){
        if( err ){
            console.error( err );
            
        }else{
            console.log( "Save File " + filename + " success."  );
        }
        wait = false;
    });
};

var Sresponse = function( text, date ){   //取回資料處理
    var $ = cheerio.load( text );
    var filename = 'empty';
    var element = new Array();
    $('tr', '#cphMain_gvList').map( function( index_tr ){
        if( 4 <= index_tr && index_tr <= 112 ){
            var water_reservoir_object = new Object();
                water_reservoir_object.id = index_tr-4;
            $(this).find('td').map( function( index_td ){
                switch( index_td ){
                    case 0: water_reservoir_object.name           = $(this).text().trim();    break;
                    case 1: water_reservoir_object.time           = $(this).html().trim();    break;
                    case 2: water_reservoir_object.precipitation  = $(this).html().trim();    break;
                    case 3: water_reservoir_object.inflow         = $(this).html().trim();    break;
                    case 4: water_reservoir_object.water_level    = $(this).html().trim();    break;
                    case 5: water_reservoir_object.f_water_level  = $(this).html().trim();    break;
                    case 6: water_reservoir_object.pondage        = $(this).html().trim();    break;
                    case 7: water_reservoir_object.pondage_percent =$(this).html().trim();    break;
                    case 8: water_reservoir_object.outflow_water_draw = $(this).html().trim();    break;
                    case 9: water_reservoir_object.outflow_electricity= $(this).html().trim();    break;
                    case 10: water_reservoir_object.outflow_scouring  = $(this).html().trim();    break;
                    case 11: water_reservoir_object.outflow_flood     = $(this).html().trim();    break;
                    case 12: water_reservoir_object.outflow_total     = $(this).html().trim();    break;
                    case 13: water_reservoir_object.prevention_flood_state    = $(this).html().trim();    break;
                    case 14: water_reservoir_object.prevention_flood_time     = $(this).html().trim();    break;
                    case 15: water_reservoir_object.prevention_flood_outflpw  = $(this).html().trim();    break;
                }
            });
            var info_time = new Date( water_reservoir_object.time );
            if( date.getTime() -3600000 < info_time.getTime() ){
                filename = water_reservoir_object.time;
                element.push( water_reservoir_object );
            }
        }
    });
    if( element.length != 0 )
        console.log( element.length );

    Save_to_file( filename, element );
/*
    for( var i in element )
        console.log( element[i] );
*/
};

var rl = readline.createInterface({
    input: process.stdin,
    output: process.stdout });

rl.on('line', function( cmd ){
    var cmd_array = cmd.split(' ');
    var time1, time2, now = new Date();

    if( cmd_array.length == 4 ){
        time1 = new Date( cmd_array[0] + ' ' + cmd_array[1] );
        time2 = new Date( cmd_array[2] + ' ' + cmd_array[3] );
    } else if( cmd_array.length == 2 ){
        time1 = new Date( cmd_array[0] );
        time2 = new Date( cmd_array[1] );
    } else {
        return;
    }

    if( !time1 || !time2 ){
        console.log('Time Error');
        return;
    } else if( time1 > time2 ){
        console.log( 'Time1 should not be after time2');
    } else if( time1 > now ){
        console.log( 'Time1 should not be after now' );
    } else {
        if( time2 > now )
            time2 = now;
        var i = time1;
        next( );
        function next( ){
            if( i > time2 ){
                return ;
            } else {
                request_water_for_time( i );
                setTimeout( function(){
                    now = new Date();
                    if( now.getMinutes() == 9 ){
                        setTimeout( 
                            function(){ 
                                console.log( "waiting for request which running each hour.");
                                next(); 
                            } ,120000 );
                    }
                    else if( !wait ){
                        wait = true;
                        i.setHours( i.getHours() +1 ) ;
                        next();
                    } else {
                        next();
                    }
                }, 2000 );
            }
        };
    }   

});

// 設定每小時的十分進行資料抓取
var schedule = require('node-schedule');
var rule = new schedule.RecurrenceRule();
